import React from 'react';

export default function App() {
  return (
    <div
      style={{
        minHeight: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        background: 'linear-gradient(135deg, #2196f3 0%, #0d47a1 100%)',
      }}
    >
      <h1
        style={{
          color: '#FFD600',
          fontSize: '4rem',
          fontWeight: 'bold',
          textShadow: '2px 2px 8px #000',
          letterSpacing: '2px',
        }}
      >
        British Open Golf
      </h1>
    </div>
  );
}
